import './comment.css';
import Likecount from './UI/likecount';
import LoggedAvatar from './UI/loggedAvatar';

const Comment = () => {
    return(
    <div className="comment">
        <Likecount/>
        <LoggedAvatar avatar={require('./UI/avatars/image-amyrobson.png')}
        className="userAvatar2"/> 
    </div>
    )
}

export default Comment;
